import data from "../Data/data.json"
const Video = ()=>{
    return(
        <>
        {data.map(el=>
            <div>
        <h2>{el.title}</h2>
              <iframe src={el.url} width="560" height="315" frameBorder="0" allowFullScreen></iframe>
              <span>{data.rating}</span>
              <button></button>
              </div>
        )}
        </>
    )
}
export default Video;
